// Импорты Java классов
var MinecraftClient = Java.type("net.minecraft.class_310");
var Objects = Java.type("java.util.Objects");
var EventPress = Java.type("ru.nedan.neverapi.event.impl.EventPress");
var ChatUtility = Java.type("ru.nedan.neverapi.etc.ChatUtility");
var URL = Java.type("java.net.URL");
var InputStreamReader = Java.type("java.io.InputStreamReader");
var BufferedReader = Java.type("java.io.BufferedReader");
var StringBuilder = Java.type("java.lang.StringBuilder");

var mc = MinecraftClient.method_1551();
var startY = 300; // Начальная позиция для списка шахт

// Переменные для хранения данных
var legendaryMines = [];
var lastUpdateTime = 0;
var lastTickTime = 0;

// Функция для обновления времени шахт каждую секунду
function updateMinesTime() {
    var currentTime = Date.now();
    if (currentTime - lastTickTime >= 1000) { // Каждую секунду
        for (var i = 0; i < legendaryMines.length; i++) {
            var mine = legendaryMines[i];
            if (mine.time !== "00:00") {
                // Уменьшаем время на 1 секунду
                var timeInSeconds = timeToSeconds(mine.time);
                if (timeInSeconds > 1) {
                    timeInSeconds--;
                    mine.time = secondsToTime(timeInSeconds);
                } else {
                    mine.time = "00:00";
                }
            }
        }
        lastTickTime = currentTime;
    }
}

// Функция для обновления данных о шахтах
function updateMinesData() {
    try {
        // Сначала отправляем запрос на обновление
        var updateUrl = new URL("http://localhost:5000/api/update");
        var updateConnection = updateUrl.openConnection();
        updateConnection.setRequestProperty("User-Agent", "Minecraft Client");
        updateConnection.setConnectTimeout(5000);
        updateConnection.setReadTimeout(5000);
        
        var updateReader = new BufferedReader(new InputStreamReader(updateConnection.getInputStream()));
        while (updateReader.readLine() !== null) {}
        updateReader.close();
        
        // Ждем 1 секунду
        java.lang.Thread.sleep(1000);
        
        // Получаем актуальные данные
        var minesUrl = new URL("http://localhost:5000/api/mines");
        var minesConnection = minesUrl.openConnection();
        minesConnection.setRequestProperty("User-Agent", "Minecraft Client");
        minesConnection.setConnectTimeout(5000);
        minesConnection.setReadTimeout(5000);
        
        var minesReader = new BufferedReader(new InputStreamReader(minesConnection.getInputStream()));
        var response = new StringBuilder();
        var line;
        
        while ((line = minesReader.readLine()) !== null) {
            response.append(line);
        }
        minesReader.close();
        
        var data = JSON.parse(response.toString());
        var mines = data.mines.spookytime;
        
        // Фильтруем только Легендарные шахты
        legendaryMines = [];
        for (var i = 0; i < mines.length; i++) {
            var mine = mines[i];
            if (mine.next === "Легендарная") {
                legendaryMines.push({
                    anarchy: mine.anarchy,
                    next: mine.next,
                    time: mine.time,
                    originalTime: mine.time // Сохраняем оригинальное время для отслеживания
                });
            }
        }
        
        // Сортируем по времени
        legendaryMines.sort(function(a, b) {
            return timeToSeconds(a.time) - timeToSeconds(b.time);
        });
        
        lastUpdateTime = Date.now();
        lastTickTime = Date.now();
        ChatUtility.sendMessage("§aДанные о шахтах обновлены! Найдено: §6" + legendaryMines.length + " §aлегендарных шахт");
        
    } catch (e) {
        ChatUtility.sendMessage("§cОшибка при обновлении данных: " + e.toString());
    }
}

// Функция для телепортации на ближайшую шахту
function teleportToNearestMine() {
    if (legendaryMines.length > 0) {
        var nearestMine = legendaryMines[0];
        chat("/an" + nearestMine.anarchy);
        ChatUtility.sendMessage("§aТелепортация на ближайшую шахту: §6" + nearestMine.anarchy + " §aчерез §e" + nearestMine.time);
        print("Телепортация на шахту: " + nearestMine.anarchy);
    } else {
        ChatUtility.sendMessage("§cНет доступных Легендарных шахт для телепортации");
    }
}

// Функция для преобразования времени в секунды
function timeToSeconds(timeStr) {
    var parts = timeStr.split(':');
    var minutes = parseInt(parts[0]);
    var seconds = parseInt(parts[1]);
    return minutes * 60 + seconds;
}

// Функция для преобразования секунд в время MM:SS
function secondsToTime(totalSeconds) {
    var minutes = Math.floor(totalSeconds / 60);
    var seconds = totalSeconds % 60;
    return (minutes < 10 ? "0" : "") + minutes + ":" + (seconds < 10 ? "0" : "") + seconds;
}

// Обработчик рендера HUD
on("ru.nedan.neverapi.event.impl.EventRender2D", function(e) {
    // Обновляем время шахт
    updateMinesTime();
    
    var yOffset = startY;
    
    // Отображаем заголовок
    mc.field_1772.method_1720(
        e.getMatrixStack(), 
        "§6Легендарные шахты (" + legendaryMines.length + "):", 
        (mc.method_22683().method_4486() - mc.field_1772.method_1727("§6Легендарные шахты (" + legendaryMines.length + "шт):") - 10), 
        yOffset, 
        -1
    );
    yOffset += 11;
    
    // Отображаем время последнего обновления
    var updateText = "§7Обновлено: " + formatTime(lastUpdateTime);
    mc.field_1772.method_1720(
        e.getMatrixStack(), 
        updateText, 
        (mc.method_22683().method_4486() - mc.field_1772.method_1727(updateText) - 10), 
        yOffset, 
        -1
    );
    yOffset += 11;
    
    // Отображаем список шахт (максимум 10 ближайших)
    var displayCount = Math.min(legendaryMines.length, 10);
    for (var i = 0; i < displayCount; i++) {
        var mine = legendaryMines[i];
        var timeColor = mine.time === "00:00" ? "§c" : "§e";
        var mineText = "Анка: §a" + mine.anarchy + " §7- " + timeColor + mine.time;
        mc.field_1772.method_1720(
            e.getMatrixStack(), 
            mineText, 
            (mc.method_22683().method_4486() - mc.field_1772.method_1727(mineText) - 10), 
            yOffset, 
            -1
        );
        yOffset += 10;
    }
    
    // Если шахт больше 10, показываем "..."
    if (legendaryMines.length > 10) {
        mc.field_1772.method_1720(
            e.getMatrixStack(), 
            "§7... и еще " + (legendaryMines.length - 10) + " шахт", 
            (mc.method_22683().method_4486() - mc.field_1772.method_1727("§7... и еще " + (legendaryMines.length - 10) + " шахт") - 10), 
            yOffset, 
            -1
        );
    }
    
    Objects.requireNonNull(mc.field_1772);
});

// Функция для форматирования времени
function formatTime(timestamp) {
    if (timestamp === 0) return "никогда";
    var diff = Date.now() - timestamp;
    var seconds = Math.floor(diff / 1000);
    var minutes = Math.floor(seconds / 60);
    
    if (seconds < 60) return seconds + " сек назад";
    if (minutes < 60) return minutes + " мин назад";
    return Math.floor(minutes / 60) + " ч назад";
}

// Обработчик нажатия клавиши C для обновления данных и телепортации
on("ru.nedan.neverapi.event.impl.EventPress", function (event) {
    if (event.getKey() === 93 && event.getAction() === 0) {
        print("Нажата клавиша C - обновляем данные и телепортируемся");
        updateMinesData();
        teleportToNearestMine();
    }
});

// Автоматическое обновление при загрузке скрипта
updateMinesData();
ChatUtility.sendMessage("§aСкрипт шахт загружен! Нажмите §6C §aдля обновления и телепортации");

// Функция для ручного обновления через чат (опционально)
function updateMines() {
    updateMinesData();
}
